import { commonLight } from '../../_styles/common';
export const self = (vars) => {
    const { primaryColorHover } = vars;
    return {
        resizableTriggerColorHover: primaryColorHover
    };
};
const themeLight = {
    name: 'Split',
    common: commonLight,
    self
};
export default themeLight;
